- input: "TEXT\x1CC00029447\x1C29406390\x1C\x1CF3XA\x1CThis report discloses payments
    to Jim Riches and Bob Lanz. While previously listed on Schedules D & E of the
    2007 Year-End Report and February 20, 2008 Report as estimated travel costs at
    the time their travel occurred, the actual travel costs and subsequent disbursements
    are disclosed on Schedules D & E of this report when their receipts were submitted
    and the payments were made. In addition, estimated travel costs were disclosed
    for Rita Riches on Schedules D & E of the February 20 Report. However, Ms. Riches
    did not travel to Florida, making her actual travel costs zero, which is also
    reflected on Schedule D of this report.  This report also discloses a $5K contribution
    to the federal account of the Montana Democratic Party on Schedule B line 23 and
    a $20K contribution to the non-federal account of the Montana Democratic Party
    on Schedule B line 29.  The PAC initially cut a $25K check that was intended for
    the non-federal account of the Party.  However, the PAC was informed by the Party
    that the entire contribution was inadvertently deposited into the federal account.
    \ The party is in the process of issuing a refund check in the amount of $20K,
    and will keep $5K in its account as the 2008 federal contribution from the PAC.
    \ When the $20K refund is received, the PAC will disclose it on the relevant FEC
    report."
